pub enum TypeBound<T> {
    Lifetime(Lifetime),
    Fn {
        forall: Vec<TypeParameter>,
        path: Path,
        parameters: Vec<T>,
        ret: Option<T>,
    },
    Trait {
        forall: Vec<TypeParameter>,
        path: Path,
        parameters: Vec<TypeBoundParameter<T>>,
    },
}

pub enum TypeBoundParameter<T> {
    Lifetime(Lifetime),
    TypeParameter(T),
    Associated(Atom, T),
}

pub enum WhereClause {
    Forall {
        binder: Vec<TypeParameter>,
        clause: Box<WhereClause>,
    },
    Bound {
        subject: TypeRepr,
        bound: TypeBound<TypeRepr>,
    },
}

pub enum TypeRepr {
    Tuple(Vec<TypeRepr>),
    Slice(Box<TypeRepr>),
    Nominal(NominalTypeRepr),
    Associated {
        type_parameter: Atom,
        id: Atom,
    },
    Lifetime(Lifetime),
    Ref {
        lifetime: Option<Lifetime>,
        mutable: bool,
        referent: Box<TypeRepr>,
    },
    TraitObject(NominalTypeRepr),
    Fn {
        forall: Vec<TypeParameter>,
        path: Path,
        parameters: Vec<TypeRepr>,
        ret: Option<Box<TypeRepr>>,
    },
}

pub enum Action<'grammar> {
    Shift(TerminalString, StateIndex),
    Reduce(&'grammar Production),
}

